import axios from 'axios';
import React, { useEffect } from 'react';

const testApi = () => {
    const getEmployeeById = async () => {
        return (await axios.get(`http://localhost:8080/api/employees/1`))
        .then((res) =>res.data)
        .catch((err) => alert(err))
    }
    
    return (
        <div>
            {getEmployeeById}
        </div>
    );
};

export default testApi;
